var __index = {"config":{"lang":["fr"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Club Cuisine","text":""},{"location":"index.html#esiee-club-cuisne","title":"ESIEE Club Cuisne","text":"<p>Bienvenue au Club de Cuisine de l'ESIEE Paris, o\u00f9 la passion pour la nourriture et la convivialit\u00e9 se rencontrent !</p>"},{"location":"index.html#a-propos-de-nous","title":"\u00c0 propos de nous","text":"<p>Le Club de Cuisine de l'ESIEE Paris est un espace pour les amateurs de bonne cuisine. Que vous soyez d\u00e9butant ou chef exp\u00e9riment\u00e9, notre club vous accueille pour partager des recettes, apprendre de nouvelles techniques et, bien s\u00fbr, d\u00e9guster des plats d\u00e9licieux.</p>"},{"location":"index.html#ce-que-nous-proposons","title":"Ce que nous proposons","text":"<ul> <li>Ateliers de cuisine : Participez \u00e0 nos ateliers r\u00e9guliers pour apprendre \u00e0 pr\u00e9parer des plats vari\u00e9s, allant des classiques de la cuisine fran\u00e7aise aux d\u00e9lices exotiques.</li> <li>\u00c9v\u00e9nements culinaires : Nous organisons des d\u00eeners \u00e0 th\u00e8me, des concours de cuisine, et des d\u00e9gustations pour mettre en avant vos talents.</li> <li>Recettes partag\u00e9es : D\u00e9couvrez nos recettes pr\u00e9f\u00e9r\u00e9es et partagez les v\u00f4tres avec la communaut\u00e9.</li> </ul>"},{"location":"index.html#nos-valeurs","title":"Nos valeurs","text":"<ul> <li>Partage et d\u00e9couverte : Chaque rencontre est une opportunit\u00e9 de d\u00e9couvrir de nouveaux plats et de partager vos cr\u00e9ations culinaires avec les autres membres.</li> <li>Passion et cr\u00e9ativit\u00e9 : Nous encourageons l'exploration de nouvelles saveurs, techniques et id\u00e9es.</li> <li>Bonne humeur : La cuisine, c'est avant tout le plaisir de cuisiner ensemble et de se r\u00e9galer !</li> </ul>"},{"location":"index.html#rejoignez-nous","title":"Rejoignez-nous !","text":"<p>Venez nous rejoindre pour apprendre, cuisiner, et profiter d\u2019une ambiance conviviale autour de bons plats ! Des \u00e9v\u00e9nements sont r\u00e9guli\u00e8rement organis\u00e9s pour les membres.</p> <p>Contact : club.cuisine@esiee.fr  </p>"},{"location":"Recettes/index.html","title":"Bienvenue sur la page des Recettes du Club de Cuisine de l'ESIEE Paris","text":"<p>Vous cherchez de nouvelles id\u00e9es pour r\u00e9galer vos papilles ? Notre club de cuisine est l\u00e0 pour vous inspirer ! D\u00e9couvrez une large s\u00e9lection de recettes, allant des plats rapides aux cr\u00e9ations gastronomiques. Il y en a pour tous les go\u00fbts, toutes les saisons, et toutes les occasions.</p>"},{"location":"Recettes/index.html#filtrage-des-recettes","title":"Filtrage des Recettes","text":""},{"location":"Recettes/index.html#categories-de-recettes","title":"Cat\u00e9gories de Recettes","text":""},{"location":"Recettes/index.html#tag:facile","title":"Facile","text":"<ul> <li>            Cake aux olives et jambon          </li> <li>            Mini Burger          </li> <li>            Mini Pain Burger          </li> <li>            Steak Burger          </li> </ul>"},{"location":"Recettes/index.html#tag:four","title":"Four","text":"<ul> <li>            Cake aux olives et jambon          </li> <li>            Mini Pain Burger          </li> </ul>"},{"location":"Recettes/index.html#tag:sans-alcool","title":"Sans alcool","text":"<ul> <li>            Cake aux olives et jambon          </li> <li>            Mini Burger          </li> <li>            Mini Pain Burger          </li> <li>            Steak Burger          </li> </ul>"},{"location":"Recettes/Mini%20pain%20burger.html","title":"Mini Pain Burger","text":"<p>Source : Ma spatule Temps de pr\u00e9paration : 30 minutes Temps de cuisson : 20  minutes Temps de repos  : 20  minutes</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#ingredients","title":"Ingr\u00e9dients","text":"<p>Pour 35 mini pains  Multiplicateur de recette : </p> - + <ul> <li>500 g farine</li> <li>20 g sucre roux</li> <li>1 grosse pinc\u00e9e de sel</li> <li>1 sachet levure s\u00e8che de boulanger</li> <li>40 g de beurre</li> <li>20 cl lait</li> <li>2 oeufs</li> <li>1 jaune d\u2019oeuf m\u00e9lang\u00e9 \u00e0 un peu de lait</li> <li>1 cuill\u00e8re environ \u00e0 caf\u00e9 de s\u00e9same noir</li> </ul>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#instructions","title":"Instructions","text":"","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-1","title":"Etape 1","text":"A savoir <p>Pour avoir une p\u00e2te homog\u00e8ne, on m\u00e9lange d'abord les ingr\u00e9dients secs.</p> <p>M\u00e9langez farine, le sel, le sucre et la levure s\u00e8che de boulanger.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-2","title":"Etape 2","text":"A noter <p>Pour il faut que sa soit juste assez chaud pour que le beurre fonde.</p> <p>Faites fondre le beurre dans le lait. Attention, le m\u00e9lange ne doit pas \u00eatre trop chaud.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-3","title":"Etape 3","text":"Aide <p>Voici \u00e0 quoi doit ressembler le puit de farine.</p> <p><p> </p></p> <p>R\u00e9alisez un puit au centre de la farine puis versez-y le m\u00e9lange lait/beurre ainsi que les 2 \u0153ufs entiers.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-4","title":"Etape 4","text":"<p>P\u00e9trissez pendant 10 minutes afin d\u2019obtenir une p\u00e2te lisse.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-5","title":"Etape 5","text":"<p>Conseil</p> <p>Pour obtenir une belle pousse :  Pr\u00e9chauffez le four \u00e0 50\u00b0 puis \u00e9teignez-le pour y mettre la p\u00e2te \u00e0 pousser.</p> <p>Formez une boule puis couvrez et laissez reposer pendant 1 heure 30 minutes.  La p\u00e2te doit doubler de volume minimum.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-6","title":"Etape 6","text":"<p>D\u00e9gazez la p\u00e2te</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-7","title":"Etape 7","text":"<p>Divisez en mini p\u00e2tons de 25 g (ou plus si vous voulez faire juste un pain a burger et pas un mini pain). </p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-8","title":"Etape 8","text":"<p>Pr\u00e9chauffez le four \u00e0 200\u00b0C.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-9","title":"Etape 9","text":"<p>Boulez-les sur un plan de travail farin\u00e9 puis d\u00e9posez-les sur la plaque \u00e0 mini buns.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-10","title":"Etape 10","text":"<p>Laissez pousser \u00e0 temp\u00e9rature ambiante 30 minutes suppl\u00e9mentaires.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-11","title":"Etape 11","text":"<p>Badigeonnez les buns avec le m\u00e9lange jaune d\u2019oeuf et lait.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Mini%20pain%20burger.html#etape-12","title":"Etape 12","text":"<p>Parsemez de s\u00e9same noir et enfournez 15 minutes.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Steak%20Burger.html","title":"Steak Burger","text":"<p>Source : Club Cuisine Temps de pr\u00e9paration : 15 minutes Temps de repos : 12h</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Steak%20Burger.html#ingredients","title":"Ingr\u00e9dients","text":"<p>Pour 500g de steak :</p> - + <ul> <li>500 g de steak hach\u00e9</li> <li>2 cuill\u00e8res \u00e0 soupe de sauce soja sal\u00e9e</li> <li>1/2 cuill\u00e8re \u00e0 caf\u00e9 de poivre</li> <li>1/2 cuill\u00e8re \u00e0 caf\u00e9 d'ail en poudre</li> <li>1/2 cuill\u00e8re \u00e0 caf\u00e9 de gingembre en poudre</li> </ul>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Steak%20Burger.html#instructions","title":"Instructions","text":"","tags":["Facile","Sans alcool"]},{"location":"Recettes/Steak%20Burger.html#etape-1","title":"Etape 1","text":"<p>M\u00e9langer tous les ingr\u00e9dients dans un saladier.</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Steak%20Burger.html#etape-2","title":"Etape 2","text":"<p>Filmer le saladier et laisser reposer au r\u00e9frig\u00e9rateur pendant 12h.</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Steak%20Burger.html#etape-3","title":"Etape 3","text":"<p>Former des steaks avec la pr\u00e9paration.</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Steak%20Burger.html#etape-4","title":"Etape 4","text":"<p>Cuire les steaks \u00e0 la po\u00eale. </p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html","title":"Cake aux olives et jambon","text":"<p>Source : Marmiton Temps de pr\u00e9paration : 30 minutes Temps de cuisson : 45 minutes</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#ingredients","title":"Ingr\u00e9dients","text":"","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#pour-6-personnes","title":"Pour 6 personnes :","text":"- + <ul> <li>1 cuill\u00e8re \u00e0 soupe d' huile</li> <li>1 sachet de levure chimique</li> <li>75 g de gruy\u00e8re r\u00e2p\u00e9</li> <li>150 g de farine</li> <li>100 g de d\u00e9s de jambon</li> <li>150 g d'olives vertes d\u00e9noyaut\u00e9es</li> <li>4 oeufs</li> <li>10 cl de lait</li> </ul> A noter <p>Vous pouvez remplacer le gruy\u00e8re rap\u00e9 par du parmesan, si c'est que vous preferez.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#instructions","title":"Instructions","text":"","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-1","title":"Etape 1","text":"<p>Pr\u00e9chauffer le four \u00e0 180\u00b0C (thermostat 6) en chaleur tournant.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-2","title":"Etape 2","text":"A noter <p>On rince les olives pour enlever \"l'exc\u00e8s\" de sel.</p> <p>Dans une passoire, \u00e9goutter les olives et rincer-les \u00e0 l'eau froide. Puis couper les olives en rondelles.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-3","title":"Etape 3","text":"<p>Verser les oeufs et la farine dans un saladier puis m\u00e9langer.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-4","title":"Etape 4","text":"<p>Ajouter le lait et l'huile puis m\u00e9langer.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-5","title":"Etape 5","text":"<p>Ajouter le jambon coup\u00e9 en carr\u00e9, les olives et le gruy\u00e8re puis m\u00e9langer.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-6","title":"Etape 6","text":"Conseils <ul> <li>Ne pas saler car le jambon et les olives le sont d\u00e9j\u00e0.</li> </ul> <p>Ajouter la levure et une pincer de poivre puis m\u00e9langer.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#etape-7","title":"Etape 7","text":"Conseils <ul> <li>Il est meilleur froid.</li> </ul> <p>Mettre le tout dans un plat \u00e0 cake au pr\u00e9alable bien beurr\u00e9 et placer au four 45 min.</p> <p>Conseils</p> <p>Laisser refroidir avant de d\u00e9mouler. Vous pouvez servir ce cake en ap\u00e9ritif ou en entr\u00e9e avec une salade verte.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Cake%20aux%20olives%20et%20jambon.html#concervation","title":"Concervation","text":"<p>Ce cake se conserve tr\u00e8s bien au r\u00e9frig\u00e9rateur pendant 2 \u00e0 3 jours.</p>","tags":["Facile","Sans alcool","Four"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html","title":"Mini Burger","text":"<p>Source : Club Cuisne Temps de d'assemblage : 30s/mini burger</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#ingredients","title":"Ingr\u00e9dients","text":"","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#prerequi","title":"Pr\u00e9requi","text":"<ul> <li>Mini pain burger</li> <li>Steak hach\u00e9 pour burger</li> </ul>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#pour-1-mini-burger","title":"Pour 1 mini burger :","text":"- + <ul> <li>1 mini pain burger</li> <li>20 g de steak hach\u00e9 pour mini burger</li> <li>1/4 de tranche de fromage \u00e0 burger</li> <li>1 feuillette de salade</li> <li>1 rondelle de tomate fine</li> <li>1 portion de sauce burger</li> </ul>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#instructions","title":"Instructions","text":"","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#etape-1","title":"Etape 1","text":"<p>Couper le mini pain burger en deux.</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#etape-2","title":"Etape 2","text":"<p>Mettre le fromage sur le steak hach\u00e9 en fin de cuisson, pour le faire fondre.</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#etape-3","title":"Etape 3","text":"<p>Mettre la sauce burger sur la partie inf\u00e9rieure du pain et un peut moin sur le dessus.</p>","tags":["Facile","Sans alcool"]},{"location":"Recettes/Entr%C3%A9es/Mini%20burger.html#etape-4","title":"Etape 4","text":"<p>Mettre le steak hach\u00e9 sur la partie inf\u00e9rieure du pain, puis la salade et la tomate et enfin la partie sup\u00e9rieure du pain.</p>","tags":["Facile","Sans alcool"]}]}